class P03
{
    /**
     * @param String $s
     * @return Integer
     */
    function lengthOfLongestSubstring($s) {
        if ($s) {
            $maxLength = 0;
            $strArr = [];
            for ($i = 0; $i < strlen($s); $i++) {
                if(in_array($s[$i], $strArr)) {
                    $prevPosition = array_search($s[$i], $strArr);
                    $strArr = array_slice($strArr, $prevPosition + 1);
                    array_push($strArr, $s[$i]);
                } else {
                    array_push($strArr, $s[$i]);
                    if(count($strArr) > $maxLength) {
                        $maxLength = count($strArr);
                    }
                }
            }
            return $maxLength;
        }
        return 0;
    }
}

